import React, { useEffect, useState } from "react";

function AddCompany() {
    const [company, setCompany] = useState();

    const handleChange = (e) => {
        const value = e.target.value.replace(/\D/g, "");
        setCompany(value);
    };

    return (
        <div className="App">

            <input value={company} onChange={handleChange} />
        </div>
    );
}

export default AddCompany;
